    false,nt"url": null,nt"notes": "The goals of this project are to enhance
    and protect roseate tern breeding and staging habitat to increase productivity,
    and improve survival of fledglings and adults prior to fall migration. This effort
    will reduce the risks from predation, habitat loss, and disturbance that are all
    exacerbated by roseate ternsu2019 use of a very small number of breeding and staging
    locations. This report highlights accomplishments completed in FY13 and FY14 in
    regards to nesting habitat restoration, annual productivity, staging habitat, and
    outreach implementation.",nt"license_title": "License Not Specified",nt"extras":
